async function fetchParkingData() {
  carsAmount = await carsInImage(sampleImage64);
  for (i in sampleData) {
    sampleData[i].freeSpaces = sampleData[i].totalSpaces - carsAmount;
  }
  // Example: return fetch('/api/parking').then(r => r.json());
  // For now we simulate latency and occasional errors.
  await new Promise(res => setTimeout(res, 600)); // simulate network
  // Simulate success:
  return sampleData.map(d => ({ ...d, lastUpdated: new Date().toISOString() }));

  // To simulate an error during development uncomment:
  // throw new Error('Simulated network error');
}

async function prediction(imageUrl) {
    const response = await fetch("https://detect.roboflow.com/parking-lot-project-akaxh/2?api_key=wiFvnwMMGiFQxyQzTFN3", {
      method: "POST",
      body: imageUrl
    });
    const result = await response.json();
    return result; // now returns a Promise that resolves to the result
}

async function carsInImage(imageUrl) {
  //implement function to turn imageURL into raw base64
  let results = await prediction(imageUrl);
  let count = 0;
  for (i in results.predictions) {
    if (results.predictions[i].class == "car") {
      count++;
    }
  }
  return count;
}

